INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (1, 2, 125801, 24001, 321, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", "リリ", 1, 0, 1, 40011);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (1, 2, 126001, 24001, 322, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", "クリア", 1, 0, 2, 40011);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (1, 2, 126101, 24001, 323, "んーと。\nこれ、あげる。\nはい", "プレシア", 1, 0, 3, 40011);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (1, 2, 125801, 24001, 324, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", "リリ", 2, 0, 4, 40011);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (1, 2, 126001, 24001, 325, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", "クリア", 2, 0, 5, 40011);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (1, 2, 126101, 24001, 326, "お兄。\nきてくれて、うれしい", "プレシア", 2, 0, 6, 40011);
